    return fact

def is_nested(string):
    # Track indices of opening and closing brackets
    opening_bracket_index = []
    closing_bracket_index = []

    # First pass: record indices of all brackets
    for i, char in enumerate(string):
        if char == '(':
            opening_bracket_index.append(i)
        elif char == ')':
            closing_bracket_index.append(i)

    # Second pass: check if brackets are properly nested
    # We'll use a stack-like approach to track nesting
    stack = []
    for i, char in enumerate(string):
        if char == '(':
            stack.append(i)
        elif char == ')':
            if stack:
                # Check if the closing bracket matches the most recent opening bracket
                if i == closing_bracket_index[stack[-1]]:
                    stack.pop()
                else:
                    # Unmatched closing bracket
                    return False

    # After processing all characters, check if stack is empty
    return len(stack) == 0

